Never gonna run around and desert you\\nNever gonna make you cry\\nNever gonna say goodbye\\nNever gonna tell a lie and hurt you\\n\\nWe’ve known each other for so long\\nYour heart’s been aching but you’re too shy to say it\\nInside we both know what’s been going on\\nWe know the game and we’re gonna play it\\n\\nAnd if you ask me how I’m feeling\\nDon’t tell me you’re too blind to see\\n\\nNever gonna give you up\\nNever gonna let you down\\nNever gonna run around and desert you\\nNever gonna make you cry\\nNever gonna say goodbye\\nNever gonna tell a lie and hurt you\\n\\n#RickAstley #NeverGonnaGiveYouUp #WheneverYouNeedSomebody #OfficialMusicVideo\x22,\x22commandRuns\x22:\x5b\x7b\x22startIndex\x22:180,\x22length\x22:16,\x22onTap\x22:\x7b\x22innertubeCommand\x22:\x7b\x22clickTrackingParams\x22:\x22CFgQ3NcEGCUiEwjo-JqLgNiJAxXfwkkHHakmI7k\x3d\x22,\x22commandMetadata\x22:\x7b\x22webCommandMetadata\x22:\x7b\x22url\x22:\x22\/hashtag\/rickastleynever\x22,\x22webPageType\x22:\x22WEB_PAGE_TYPE_BROWSE\x22,\x22rootVe\x22:6827,\x22apiUrl\x22:\x22\/youtubei\/v1\/browse\x22\x7d\x7d,\x22browseEndpoint\x22:\x7b\x22browseId\x22:\x22FEhashtag\x22,\x22params\x22:\x226gUTCg9yaWNrYXN0bGV5bmV2ZXIYAQ%3D%3D\x22\x7d\x7d\x7d,\x22loggingDirectives\x22:\x7b\x22trackingParams\x22:\x22CFgQ3NcEGCUiEwjo-JqLgNiJAxXfwkkHHakmI7k\x3d\x22,\x22enableDisplayloggerExperiment\x22:true\x7d\x7d,\x7b\x22startIndex\x22:197,\x22length\x22:25,\x22onTap\x22:\x7b\x22innertubeCommand\x22:\x7b\x22clickTrackingParams\x22:\x22CAYQ040EGAIiEwjo-JqLgNiJAxXfwkkHHakmI7lIxLuBrb2YjoZ1\x22,\x22commandMetadata\x22:\x7b\x22webCommandMetadata\x22:\x7b\x22url\x22:\x22https:\/\/www.youtube.com\/redirect?event\x3dvideo_description\\u0026redir_token\x3dQUFFLUhqbHhRbXpmWTh4NFJaUUVmYWpPN1pibWtRNzdqQXxBQ3Jtc0ttUTFlVFN3aGEwRmVBQ2NtcndrdVhKZnh1TWFQajN3OGtMMGk3RExNUFZsZUJjblJoZGo0WUljNExKSU9WMi1FNF84a0lZZmlzVlUzcXRkQ2JlTXZqd19mcTRRS2ZyZjJ5YnYyM255dHI5VHptOXVUMA\\u0026q\x3dhttps%3A%2F%2Flinktr.ee%2Frickastleynever\\u0026v\x3ddQw4w9WgXc
